          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](53, "2.2. Registracijos metu pildydami mok\u0117jimo informacij\u0105 privalote pateikti savo banko duomenis. Jei esate juridinis asmuo, privalote \u012Fra\u0161yti bedrov\u0117s banko s\u0105skaitos numer\u012F. Mes per program\u0117l\u0119 atliktus mok\u0117jimus pervedame \u012F j\u016Bs\u0173 nurodyt\u0105 banko ar kreditin\u0117s kortel\u0117s s\u0105skait\u0105. Mes neatsakome u\u017E neteisingai atliktus pinig\u0173 pavedimus nurod\u017Eius neteisingus banko duomenis. ");

