          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](61, "2.6. Paskyros registracija juridiniams asmenims (t. y. bendrov\u0117ms). Esate laikomas juridiniu asmeniu, jei mok\u0117jimo duomenyse (prieinamuose \u201EA\u0161 dirbu\" tiek\u0117jo paskyroje) mokes\u010Di\u0173 gav\u0117jas nurodytas kaip juridinis asmuo. Tokiu atveju nurodytas juridinis asmuo laikomas paslaug\u0173 teik\u0117ju ir \u0161i\u0173 Bendr\u0173j\u0173 s\u0105lyg\u0173, Sutarties ir tolesni\u0173 susitarim\u0173 \u0161alimi. Fakti\u0161kai paslaugas gali teikti tik konkretus fizinis asmuo, nurodytas registracijos proceso metu. Toks fizinis asmuo tiek\u0117jo paskyra gali naudotis tik tuo atveju, jei perskait\u0117 ir sutiko b\u016Bti saistomas \u0161i\u0173 Bendr\u0173j\u0173 s\u0105lyg\u0173, Sutarties, ir tolesni\u0173 dokument\u0173, sudaran\u010Di\u0173 \u0161ios sutarties dal\u012F. MOK\u0116JIMO DUOMENYSE NURODYTAS JURIDINIS ASMUO IR FIZINIS ASMUO, FAKTI\u0160KAI TEIKIANTIS PASLAUGAS NAUDODAMAS \u201EA\u0161 dirbu\" PASKYR\u0104, LIEKA SOLIDARIAI ATSAKINGI U\u017D TIEK\u0116JO ATLIKTUS BENDR\u0172J\u0172 S\u0104LYG\u0172 IR SUTARTIES PA\u017DEIDIMUS.");

