          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](67, "3.1. Leidimas naudotis \u201EA\u0161 dirbu\" program\u0117le ir \u201EA\u0161 dirbu\" tiek\u0117jo paskyra. Suteikiame jums leidim\u0105 naudotis \u201EA\u0161 dirbu\" program\u0117le ir \u201EA\u0161 dirbu\" tiek\u0117jo paskyra. Leidimas nesuteikia jums teis\u0117s perleisti jo tretiesiems asmenims ar perduoti jiems savo teises. Neatsi\u017Evelgiant \u012F tai, kas i\u0161d\u0117styta prie\u0161 tai ir jei taip susitarta atskirai, daugelio tiek\u0117j\u0173 atstovai gali perleisti leidim\u0105 naudotis \u201EA\u0161 dirbu\" program\u0117le ir \u201EA\u0161 dirbu\" tiek\u0117jo paskyra savo kolektyvo nariams. ");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](68, "p");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](69, "3.2. Naudojantis \u201EA\u0161 dirbu\" program\u0117le ir (arba) \u201EA\u0161 dirbu\" tiek\u0117jo paskyra draud\u017Eiama: dekompiliuojant, naudojant apgr\u0105\u017Eos in\u017Einerij\u0105 ar kitais b\u016Bdais m\u0117ginti i\u0161gauti \u201EA\u0161 dirbu\" program\u0117l\u0117s, \u201EA\u0161 dirbu\" tiek\u0117jo paskyros ar kitos \u201EA\u0161 dirbu\" programin\u0117s \u012Frangos pradin\u012F kod\u0105; bet kokiu b\u016Bdu ar forma keisti \u201EA\u0161 dirbu\" program\u0117l\u0119 ar \u201EA\u0161 dirbu\" tiek\u0117jo paskyr\u0105 arba naudoti pakeistas \u201EA\u0161 dirbu\" program\u0117l\u0117s arba \u201EA\u0161 dirbu\" tiek\u0117jo paskyros versijas; perduoti virusais u\u017Ekr\u0117stus, sugadintus failus ar kitas programas, kurios gal\u0117t\u0173 pakenkti ar neigiamai paveikti \u201EA\u0161 dirbu\" platformos veikim\u0105; m\u0117ginti neleistinai prisijungti prie \u201EA\u0161 dirbu\" program\u0117l\u0117s, \u201EA\u0161 dirbu\" tiek\u0117jo paskyros ar kit\u0173 \u201EA\u0161 dirbu\" paslaug\u0173. ");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](70, "p");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](71, "3.3. \u0160iuo dokumentu suteikiamas leidimas automati\u0161kai at\u0161aukiamas nutraukus sutart\u012F. Nutraukus sutart\u012F, privalote nedelsdami liautis naudotis \u201EA\u0161 dirbu\" program\u0117le ir \u201EA\u0161 dirbu\" tiek\u0117jo paskyra, o mes turime teis\u0119 be i\u0161ankstinio \u012Fsp\u0117jimo u\u017Eblokuoti ir i\u0161trinti tiek\u0117jo paskyr\u0105.");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](72, "p");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](73, "3.4. \u201EA\u0161 dirbu\" \u017Eym\u0173 ir etike\u010Di\u0173 naudojimas. Mes galime i\u0161duoti jums \u017Eymas, etiketes, lipdukus ir kitus \u201EA\u0161 dirbu\" prek\u0117s \u017Eenkl\u0105 \u017Eymin\u010Dius \u017Eenklus, nurodan\u010Dius, kad naudojat\u0117s \u201EA\u0161 dirbu\" platforma. Suteikiame jums nei\u0161imtin\u012F, neperleid\u017Eiam\u0105 ir neperduodam\u0105 leidim\u0105 naudoti \u0161iuos \u017Eenklus, su s\u0105lyga, kad jie bus naudojami vieninteliu tikslu \u2013 nurodyti, kad teikiate paslaugas per \u201EA\u0161 dirbu\" platform\u0105. Nutraukus sutart\u012F, privalote pa\u0161alinti ir i\u0161mesti visus \u201EA\u0161 dirbu\" prek\u0117s \u017Eenkl\u0105 \u017Eymin\u010Dius \u017Eenklus. ");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](74, "p");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](75, "3.5. Visos autoriaus teis\u0117s ir prek\u0117s \u017Eenklai, \u012Fskaitant pradinius kodus, duomen\u0173 bazes, logotipus ir vaizdin\u012F apipavidalinim\u0105, priklauso \u201EA\u0161 dirbu\" ir yra saugomi autoriaus teisi\u0173, prek\u0117s \u017Eenkl\u0173 ir (arba) komercini\u0173 paslap\u010Di\u0173 \u012Fstatym\u0173 ir tarptautini\u0173 sutar\u010Di\u0173 nuostat\u0173. Naudodamiesi \u201EA\u0161 dirbu\" platforma ar kitomis \u201EA\u0161 dirbu\" paslaugomis, ne\u012Fgyjate joki\u0173 nuosavyb\u0117s teisi\u0173 \u012F intelektin\u0119 nuosavyb\u0119. ");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](76, "h5", 5);

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](77, "4. PASLAUG\u0172 TEIKIMAS");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](78, "p");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](79, "4.1. Tiek\u0117jo \u012Fsipareigojimai. U\u017Etikrinate, kad paslaugas teiksite pagal Bendr\u0105sias s\u0105lygas, Sutart\u012F bei \u0161alies, kurioje teikiate paslaugas, \u012Fstatymus ir teis\u0117s aktus. \u012Esid\u0117m\u0117kite, kad prisiimate visi\u0161k\u0105 atsakomyb\u0119 u\u017E vietos \u012Fstatym\u0173 ir teis\u0117s akt\u0173 pa\u017Eeidimus, \u012Fvykdytus teikiant paslaugas.");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](80, "p");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](81, "4.2. Privalote tur\u0117ti visus paslaugoms teikti b\u016Btinus pa\u017Eym\u0117jimus, leidimus, licencijas, civilin\u0117s atsakomyb\u0117s draudim\u0105 (jei taikoma), registracijos dokumentus, sertifikatus ir kitus dokumentus, reikalaujamus atitinkamoje jurisdikcijoje. \u012Esipareigojate pasir\u016Bpinti vis\u0173 min\u0117t\u0173 dokument\u0173 galiojimu. \u201EA\u0161 dirbu\" pasilieka teis\u0119 pareikalauti pavirtinti, kad turite atnaujinimui pateikti visas b\u016Btinus pa\u017Eym\u0117jimus, leidimus, patvirtinimus, \u012Fgaliojimus, registracijos dokumentus ir sertifikatus arba pateikti patvirtinimus, kad turite \u0161iuos dokumentus.");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](82, "p");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](83, "4.3. Privalote paslaugas teikti profesionaliai, laikydamiesi \u0161i\u0173 paslaug\u0173 teikimui taikomos verslo etikos, bei stengtis pirk\u0117jo pra\u0161ym\u0105 i\u0161pildyti atsi\u017Evelgdami \u012F jo interesus. Be kit\u0173 dalyk\u0173, i) privalote teikti kokybi\u0161kas paslaugas; ii) privalote tinkamai reprezentuoti \u201CA\u0161 dirbu\u201D \u012Fvaizd\u012F, b\u016Bti mandagus, tvarkingai apsireng\u0119 (tvarkinga darbin\u0117 apranga), nesikeikti, elgtis eti\u0161kai ir mandagiai; iii) negalite teikti paslaugas su kitais nepa\u017E\u012Fstamais asmenimis; iv) privalote laikytis galiojan\u010Di\u0173 LR \u012Fstaym\u0173 ir etiketo norm\u0173; v) atvykus pas pirk\u0117j\u0105 draud\u017Eiama bendrauti telefonu, nebent tai b\u016Btina norint atlikti paslaug\u0105.");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](84, "p");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](85, "4.4. Turite i\u0161imtin\u0119 teis\u0119 nuspr\u0119sti, kada norite teikti paslaugas. Pirk\u0117j\u0173 pra\u0161ymus d\u0117l paslaug\u0173 priimate, atmetate arba ignoruojate savo nuo\u017Ei\u016Bra. ");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](86, "p");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](87, "4.5. I\u0161laidos, patiriamos teikiant paslaugas. Privalote savo s\u0105skaita pasir\u016Bpinti visa \u012Franga ir priemon\u0117mis, b\u016Btinomis paslaugoms teikti, \u012Fskaitant darbo priemones, asmenin\u0117s saugos priemones, draudimus, i\u0161man\u0173j\u012F telefon\u0105 ir kt., ir jas pri\u017Ei\u016Br\u0117ti. Taip pat esate atsakingas u\u017E visas i\u0161laidas, patirtas teikiant paslaugas, \u012Fskaitant, bet neapsiribojant degalais, mobili\u0173j\u0173 duomen\u0173 plan\u0173 mokes\u010Diais, muito mokes\u010Diais, transporto priemon\u0117s nusid\u0117v\u0117jimu, draudimu, atitinkamais pelno arba darbo u\u017Emokes\u010Dio fondo mokes\u010Diais ir t. t. Atkreipkite d\u0117mes\u012F, kad naudodamiesi \u201EA\u0161 dirbu\" program\u0117le i\u0161naudosite didel\u012F kiek\u012F mobili\u0173j\u0173 duomen\u0173, tod\u0117l si\u016Blome u\u017Esisakyti duomen\u0173 plan\u0105, leid\u017Eiant\u012F duomenimis naudotis neribotai arba suteikiant\u012F labai didel\u012F j\u0173 kiek\u012F. ");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](88, "p");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](89, "4.6. Mokes\u010Diai. Turite teis\u0119 pra\u0161yti mokes\u010Dio kiekvien\u0105 kart\u0105 patvirtin\u0119 \u201EA\u0161 dirbu\" platformoje ir pagal pageidavim\u0105 suteik\u0119 paslaug\u0105 (t. y. mokes\u010Dio). Mokestis apskai\u010Diuojamas remiantis j\u016Bs\u0173 nurodytu baziniu mokes\u010Diu, ir konkre\u010Dios paslaugos suteikimo trukme. Numatytasis bazinis mokestis gali kisti priklausomai nuo J\u016Bs\u0173 nurodytos sumos. Mokest\u012F su mumis galite derinti atsi\u0173sdami atitinkam\u0105 elektroniniu b\u016Bdu arba ranka pasira\u0161yt\u0105 pra\u0161ym\u0105. Be to, visuomet turite teis\u0119 imti i\u0161 pirk\u0117jo ma\u017Eesn\u012F mokest\u012F, nei nurodytasis \u201EA\u0161 dirbu\" program\u0117l\u0117je. Tiesa, taikant pirk\u0117jui ma\u017Eesn\u012F mokest\u012F nei nurodytasis \u201EA\u0161 dirbu\" program\u0117l\u0117je, \u201EA\u0161 dirbu\" mokestis nesuma\u017E\u0117ja.");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](90, "p");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](91, "4.7. Fiksuota paslaugos kaina. Pirk\u0117jui gali b\u016Bti suteiktas pasirinkimas leid\u017Eiantis sutikti su fiksuotu mokes\u010Diu konkre\u010Diai paslaugai, kurios paslaugos tiek\u0117jas esate j\u016Bs (pvz., fiksuota paslaugos kaina). Fiksuota paslaugos kaina pirk\u0117jui nurodoma \u201EA\u0161 dirbu\" program\u0117l\u0117je prie\u0161 u\u017Esakant paslaug\u0105, o jums pri\u0117mus u\u017Esakym\u0105 arba suteikus paslaug\u0105. Mokestis u\u017E paslaug\u0105 bus skai\u010Diuojamas kaip nurodyta 4.6. punkte vietoj fiksuotos paslaugos kainos tuomet, pirk\u0117jui paslaugos teikimo metu pakeitus paslaugos teikimo trukm\u0119, d\u0117l neplanuoto didesnio kr\u016Bvio ar kit\u0173 aplinkybi\u0173 paslaugos teikimui u\u017Etrukus \u017Eenkliai ilgiau nei apskai\u010Diuota, ar kitoms nenumatytoms aplinkyb\u0117ms turin\u010Dioms reik\u0161ming\u0105 \u012Ftak\u0105 paslaugos suteikimui (pvz. Reikalinga papikdoma \u012Franga norint atlikti darbus).");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](92, "p");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](93, "4.8. Jei supratote, kad apskai\u010Diuojant mokest\u012F buvo atlikta klaida ir norite mokes\u010Dio skai\u010Diavim\u0105 pataisyti, turite pateikti pra\u0161ym\u0105 skiltyje \u201CAtlikta paslauga\u201D \u201EA\u0161 dirbu\" program\u0117l\u0117je. Jei pra\u0161ymas \u201EA\u0161 dirbu\" program\u0117l\u0117s skiltyje \u201EAtlika paslauga\" nepateikiamas, \u201EA\u0161 dirbu\" mokes\u010Dio neperskai\u010Diuoja ir neatlygina jums u\u017E klaid\u0105, padaryt\u0105 j\u012F apskai\u010Diuojant. ");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](94, "p");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](95, "4.9. \u201EA\u0161 dirbu\" gali pakoreguoti mokest\u012F u\u017E tam tikr\u0105 atlikt\u0105 u\u017Esakym\u0105, mums nusta\u010Dius pa\u017Eeidim\u0105 (pvz., kad paslaugos teikimas buvo atliktas per ilgesn\u012F nei numatyta laik\u0105) arba technin\u0119 klaid\u0105, d\u0117l kurios pakito galutin\u0117 kaina. \u201EA\u0161 dirbu\" taip pat gali suma\u017Einti arba at\u0161aukti mokest\u012F esant pagr\u012Fstai prie\u017Eas\u010Diai manyti, kad buvo suk\u010Diauta arba jeigu remiantis pirk\u0117jo skundu nustatoma, kad \u012Fvykd\u0117te pa\u017Eeidim\u0105. \u201EA\u0161 dirbu\" \u0161i\u0105 teis\u0119 suma\u017Einti ar at\u0161aukti mokest\u012F taiko tik esant pagr\u012Fstai prie\u017Eas\u010Diai. ");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](96, "p");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](97, "4.10. Pirk\u0117jas mokest\u012F u\u017E paslaugas gali sumok\u0117ti per program\u0117l\u0119, kaip nurodyta \u0161i\u0173 Bendr\u0173j\u0173 s\u0105lyg\u0173 6 skyriuje. Jei pirk\u0117jas negali ar atsisako sumok\u0117ti, \u201EA\u0161 dirbu\" j\u016Bs\u0173 vardu pirk\u0117jui i\u0161duoda prane\u0161im\u0105 apie skol\u0105. \u0160i teis\u0117 grind\u017Eiama \u201EA\u0161 dirbu\" suteiktu mok\u0117jim\u0173 tarpininko \u012Fgaliojimu ir nerei\u0161kia, kad \u201EA\u0161 dirbu\" yra \u012Fpareigoti atlyginti pirk\u0117jo nesumok\u0117t\u0105 mokest\u012F. Jei paslaugos pirk\u0117jai nesutinka mok\u0117ti u\u017E paslaugos suteikim\u0105, mokest\u012F moka paslaug\u0105 u\u017Esak\u0119s pirk\u0117jas. Jei pirk\u0117jas pagr\u012Fstai atsisako mok\u0117ti, motyvuodamas tuo, kad \u201EA\u0161 dirbu\" program\u0117l\u0117je pateik\u0117te neteising\u0105 informacij\u0105, \u201EA\u0161 dirbu\" jums toki\u0173 i\u0161laid\u0173 neatlygina. ");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](98, "p");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](99, "4.11. Kvitai. Kiekvien\u0105 kart\u0105 s\u0117kmingai atlikus paslaugas, \u201EA\u0161 dirbu\" suformuoja ir pirk\u0117jui pateikia kvit\u0105, kuriame nurodoma \u0161i informacija: \u012Fmon\u0117s pavadinimas, veiklos vieta, tiek\u0117jo vardas ir pavard\u0117, tiek\u0117jo nuotrauka, paslaugos licencijos numeris (jei taikoma), paslaugos atlikimo data, laikas, trukm\u0117 bei mokestis, sumok\u0117tas u\u017E paslaug\u0173 suteikim\u0105. Kvitus u\u017E visas suteiktas paslaugas galite rasti \u201EA\u0161 dirbu\" tiek\u0117jo paskyroje. ");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](100, "p");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](101, "4.12. Paslaugos at\u0161aukimo mokestis ir laukimo mokestis. Pirk\u0117jas gali at\u0161aukti u\u017Esakym\u0105 paslaugai su kuria tiek\u0117jas sutiko per \u201EA\u0161 dirbu\" program\u0117l\u0119. Jei veikl\u0105 teikian\u010Dioje rinkoje yra taikomas paslaugos at\u0161aukimo mokestis, tiek\u0117jui jis priklauso tuo atveju, kai pirk\u0117jas at\u0161aukia tiek\u0117jo priimt\u0105 u\u017Esakym\u0105 paslaugai po tam tikro laiko nustatyto \u201EA\u0161 dirbu\" program\u0117l\u0117je. Taip pat gali b\u016Bti taikomas laukimo mokestis, pagal s\u0105lygas, kurios nurodytos \u201EA\u0161 dirbu\" program\u0117l\u0117je.");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](102, "p");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](103, "4.13. Jei teikiant paslaugas, pirk\u0117jas ar kiti asmenys tuo metu esantys paslaugos teikimo vietoje, per savo aplaidum\u0105 apgadina \u012Frang\u0105, turite teis\u0119 pareikalauti pirk\u0117jo sumok\u0117ti iki 50 EUR baud\u0105 bei padengti baud\u0105 vir\u0161ijan\u010Di\u0105 \u017Eal\u0105. Jei pirk\u0117jas nesutinka atlyginti \u017Ealos, privalote prane\u0161ti mums \u2013 mes j\u016Bs\u0173 vardu i\u0161ie\u0161kosime i\u0161 pirk\u0117jo baud\u0105 ir (arba) atitinkamas i\u0161laidas. Tiesa, tur\u0117kite omenyje, kad mes neprisiimame atsakomyb\u0117s u\u017E tiesiogin\u0119 ar netiesiogin\u0119 \u017Eal\u0105, susijusi\u0105 su turto, \u012Franki\u0173 ar kit\u0173 darbo priemoni\u0173 technin\u0117s prie\u017Ei\u016Bros ar remonto darbais, d\u0117l kuri\u0173 kaltas pirk\u0117jas. ");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](104, "p");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](105, "4.14. J\u016Bs\u0173 mokestin\u0117s prievol\u0117s. Sutinkate su tuo, kad \u012Fsipareigojate visi\u0161kai laikytis vis\u0173 mokestini\u0173 prievoli\u0173, kylan\u010Di\u0173 i\u0161 taikom\u0173 \u012Fstatym\u0173, susijusi\u0173 su paslaug\u0173 teikimu, \u012Fskaitant i) pajam\u0173 mokes\u010Dio, socialinio draudimo mokes\u010Dio ir kit\u0173 taikom\u0173 mokes\u010Di\u0173 sumok\u0117jim\u0105; ii) vis\u0173 darbuotoj\u0173 ir mokes\u010Di\u0173 registracijos prievoli\u0173 d\u0117l skai\u010Diavim\u0173, susijusi\u0173 buhalterine apskaita ir pervedimu \u012F atitinkamas valstybines institucijas pagal galiojan\u010Dius \u012Fstatymus, \u012Fvykdym\u0105. Mokes\u010Di\u0173 inspekcijai mums pateikus pagr\u012Fst\u0105 pra\u0161ym\u0105 pateikti informacij\u0105 apie j\u016Bs\u0173 veikl\u0105, mes suteiksime mokes\u010Di\u0173 inspekcijai prieig\u0105 prie informacijos apie j\u016Bs\u0173 veikl\u0105, nevir\u0161ydami galiojan\u010Diuose teis\u0117s aktuose numatyt\u0173 rib\u0173. Be to, j\u016Bs\u0173 pareiga yra laikytis vis\u0173 galiojan\u010Di\u0173 mokes\u010Di\u0173 teis\u0117s akt\u0173, taikom\u0173 paslaug\u0173 teikimui. Sutinkate atlyginti \u201EA\u0161 dirbu\" visus valstybinius mokes\u010Dius, reikalavim\u0173 sumas, mok\u0117jimus, baudas ir kitas mokestines prievoles, patirtas \u201EA\u0161 dirbu\" d\u0117l j\u016Bs\u0173 ne\u012Fvykdyt\u0173 taikomuose mokes\u010Di\u0173 teis\u0117s aktuose numatyt\u0173 prievoli\u0173 (\u012Fskaitant pajam\u0173 mokes\u010Dio ir socialinio draudimo mokes\u010Dio sumok\u0117jim\u0105). ");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](106, "p");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](107, "4.15. Tiek\u0117jo teis\u0117 i\u0161duoti s\u0105skaita fakt\u016Bras. \u201EA\u0161 dirbu\" turi teis\u0119 j\u016Bs\u0173 vardu i\u0161ra\u0161yti pirk\u0117jui s\u0105skait\u0105 fakt\u016Br\u0105, siekiant atlyginti jums bet kokius mokes\u010Dius, sutartines baudas ar kitus mokes\u010Dius, kuriuos jums perveda \u201EA\u0161 dirbu\". S\u0105skait\u0105 fakt\u016Br\u0105 rasite \u201EA\u0161 dirbu\" tiek\u0117jo paskyroje. ");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](108, "h5", 5);

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](109, "5. \u201EA\u0161 dirbu\" MOKES\u010CIAI");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](110, "p");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](111, "5.1. Nor\u0117dami naudotis \u201EA\u0161 dirbu\" paslaugomis, privalote sumok\u0117ti mokest\u012F (t. y. \u201EA\u0161 dirbu\" mokest\u012F). \u201EA\u0161 dirbu\" mokestis mokamas remiantis kiekvieno j\u016Bs\u0173 atlikto paslaugos u\u017Esakymo mokes\u010Diu. \u201EA\u0161 dirbu\" mokes\u010Dio suma jums prane\u0161ama el. pa\u0161tu, \u201EA\u0161 dirbu\" program\u0117l\u0117je, \u201EA\u0161 dirbu\" tiek\u0117jo paskyroje arba kitomis atitinkamomis priemon\u0117mis. Tur\u0117kite omenyje, kad \u201EA\u0161 dirbu\" mokestis kartais gali keistis. Mes prie\u0161 kiekvien\u0105 tok\u012F pasikeitim\u0105 jums atsi\u0173sime i\u0161ankstin\u012F prane\u0161im\u0105. ");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](112, "p");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](113, "5.2. \u201EA\u0161 dirbu\" mokest\u012F ar kitus mokes\u010Dius, kuriuos privalote sumok\u0117ti mums u\u017E pra\u0117jus\u012F m\u0117nes\u012F, turite sumok\u0117ti ne v\u0117liau kaip iki kito m\u0117nesio -7- tos dienos. Pav\u0117lavus sumok\u0117ti \u201EA\u0161 dirbu\" mokest\u012F, privalote sumok\u0117ti delspinigius, kuri\u0173 dydis lygus 0,04 % (keturioms \u0161imtosioms procento) nesumok\u0117tos sumos u\u017E kiekvien\u0105 dien\u0105. Privalote padengti visas m\u016Bs\u0173 patirtas i\u0161laidas, susijusias su skol\u0173 i\u0161ie\u0161kojimu.");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](114, "h5", 5);

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](115, "6. PER PROGRAM\u0116L\u0118 ATLIEKAMI MOK\u0116JIMAI");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](116, "p");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](117, "6.1. Mes galime suteikti pirk\u0117jams galimyb\u0119 sumok\u0117ti u\u017E paslaug\u0105 tiesiogiai per \u201EA\u0161 dirbu\" program\u0117l\u0119 (per program\u0117l\u0119 atliekamas mok\u0117jimas) kortele, atsiskaitant el. bankininkyst\u0117s ar kitais mok\u0117jimo b\u016Bdais. Leid\u017Eiate mums veikti kaip j\u016Bs\u0173 ribot\u0173 \u012Fgaliojim\u0173 prekybos agentas i\u0161imtinai siekiant j\u016Bs\u0173 vardu surinkti pirk\u0117jo per program\u0117l\u0119 sumok\u0117tus mokes\u010Dius bei kitus mokes\u010Dius. Bet kokia per program\u0117l\u0119 atlikta mok\u0117jimo prievol\u0117 laikoma \u012Fvykdyta mok\u0117jimo atlikimo momentu. ");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](118, "p");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](119, "6.2. Neturite teis\u0117s atmesti pirk\u0117jo per program\u0117l\u0119 atlikto mok\u0117jimo arba bandyti atkalb\u0117ti pirk\u0117jo nuo mok\u0117jimo per program\u0117l\u0119. Jums be pagr\u012Fstos prie\u017Easties atsisakius priimti per program\u0117l\u0119 atlikt\u0105 mok\u0117jim\u0105, mes turime teis\u0119 pritaikyti jums 15 eur\u0173 dyd\u017Eio sutartin\u0119 baud\u0105 u\u017E kiekvien\u0105 atsisakymo atvej\u012F ir (arba), elgesiui kartojantis, u\u017Eblokuoti j\u016Bs\u0173 teis\u0119 naudotis \u201EA\u0161 dirbu\" paslaugomis. ");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](120, "p");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](121, " 6.3. \u201EA\u0161 dirbu\" pasilieka teis\u0119 savo nuo\u017Ei\u016Bra platinti nuolaidos kodus savo klientams reklaminiais tikslais. J\u016Bs sutinkate su nuolaidos kodo panaudojimo tvarka nepriklausomai ar paslauga apmokama per program\u0117l\u0119 ar grynaisiais. \u012Etarus, kad nuolaidos kod\u0173 naudojimas yra apgaulingas, neteis\u0117tas, tiek\u0117jo naudojamas nesilaikant nuolaidos kod\u0173 naudojimo taisykli\u0173 ir s\u0105lyg\u0173, nuolaidos kodas gali b\u016Bti panaikintas, o neapmok\u0117to skirtumo \u201EA\u0161 dirbu\" tiek\u0117jui nekompensuoja.");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](122, "p");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](123, "6.4. Turite teis\u0119 per\u017Ei\u016Br\u0117ti per program\u0117l\u0119 atlikt\u0173 mok\u0117jim\u0173 ataskaitas \u201EA\u0161 dirbu\" tiek\u0117jo paskyroje arba program\u0117l\u0117je. Ataskaitoje nurodomos per program\u0117l\u0119 atlikt\u0173 mok\u0117jim\u0173 sumos, pervestos pra\u0117jusi\u0105 savait\u0119, bei atskaitytos \u201EA\u0161 dirbu\" mokes\u010Dio sumos. Privalote mus informuoti apie svarbias aplinkybes, kurios gal\u0117t\u0173 tur\u0117ti \u012Ftakos m\u016Bs\u0173 \u012Fsipareigojim\u0173 surinkti ir paskirstyti per program\u0117l\u0119 sumok\u0117tus mokes\u010Dius vykdymui. ");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](124, "p");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](125, "6.5. Mes nesame \u012Fsipareigoj\u0119 i\u0161mok\u0117ti jums mokes\u010Dio, kur\u012F jums skolingas pirk\u0117jas, tuo atveju, jei per program\u0117l\u0119 atliktas mok\u0117jimas nebuvo \u012Fskaitytas d\u0117l netinkamos pirk\u0117jo kreditin\u0117s kortel\u0117s arba kitokio pob\u016Bd\u017Eio mok\u0117jimas at\u0161aukiamas ar ne\u012Fskaitomas d\u0117l kit\u0173 prie\u017Eas\u010Di\u0173. Tokiu atveju pad\u0117sime jums i\u0161reikalauti i\u0161 pirk\u0117jo nesumok\u0117to mokes\u010Dio ir perversime j\u012F jums, kai tik pirk\u0117jas atliks pra\u0161om\u0105 mok\u0117jim\u0105. ");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](126, "p");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](127, "6.6. Prie\u0161 teikdami paslaugas, privalote \u012Fsitikinti, kad paslauga i\u0161 ties\u0173 teikiama atitinkamam pirk\u0117jui arba, kad pirk\u0117jas tiesiogiai patvirtino, jog leid\u017Eia kitiems pirk\u0117jams pirkti paslaugas naudojantis pirk\u0117jo paskyra. Jei per klaid\u0105 identifikavote ne t\u0105 pirk\u0117j\u0105, o per program\u0117l\u0119 atliekamas mok\u0117jimas priskiriamas asmeniui, kuriam nebuvo suteiktos paslaugos arba kuris neu\u017Esak\u0117 \u0161i\u0173 paslaug\u0173 kitiems pirk\u0117jams, tuomet mes atlyginame \u0161iam asmeniui mokest\u012F. Tokiu atveju j\u016Bs neturite teis\u0117s atgauti mokes\u010Dio i\u0161 m\u016Bs\u0173. Be to, u\u017E kiekvien\u0105 netinkamai priskirt\u0105 per program\u0117l\u0119 atlikt\u0105 mok\u0117jim\u0105 mes turim teis\u0119 pritaikyti jums sutartin\u0119 baud\u0105 iki 10 eur\u0173. ");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](128, "p");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](129, "6.7. Atkreipkite d\u0117mes\u012F, kad mes visus mokes\u010Dius, sumok\u0117tus per program\u0117l\u0119 atliktais mok\u0117jimais, atskaitysime i\u0161 sum\u0173, kurias esate mums skolingi (pvz., \u201EA\u0161 dirbu\" mokes\u010Di\u0173 ir sutartini\u0173 baud\u0173). Mes pasiliekame teis\u0119 \u012Fvykdyti bet kuriuos i\u0161 j\u016Bs\u0173 finansini\u0173 \u012Fsipareigojim\u0173 bet kurioms UAB \u201EPILKA LINIJA\" grup\u0117s \u012Fmon\u0117ms \u2013 tokiu atveju mes \u012Fgyjame teis\u0119 pateikti jums mok\u0117jimo reikalavim\u0105. Mes galime bet kokius j\u016Bs\u0173 finansinius \u012Fsipareigojimus atskaityti i\u0161 finansini\u0173 \u012Fsipareigojim\u0173, kuriuos esate i\u0161k\u0117l\u0119 mums. ");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](130, "p");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](131, "6.8. Jei mes negalime sumok\u0117ti jums mokes\u010Di\u0173 d\u0117l to, kad nepateik\u0117te savo banko s\u0105skaitos duomen\u0173 savo tiek\u0117jo paskyroje arba jei banko s\u0105skaitos duomenys nurodyti neteisingai, tuomet mes tokius mok\u0117jimus laikome 180 dien\u0173. Jei per 180 dien\u0173 nuo dienos, kai \u012Fgyjama teis\u0117 reikalauti \u0161i\u0173 mok\u0117jim\u0173, nepateikiate mums teising\u0173 banko s\u0105skaitos duomen\u0173, j\u016Bs\u0173 reikalavimo d\u0117l jums nepervesto mokes\u010Dio sumok\u0117jimo terminas laikomas pasibaigusiu.");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](132, "h5", 5);

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](133, "7. PAGALBA KLIENTAMS");

