          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](134, "p");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](135, "Tiek\u0117jams teikiama pagalbos klientams d\u0117l naudojimosi \u201EA\u0161 dirbu\" paslaugomis paslauga. Mes pasiliekame teis\u0119 nebeteikti pagalbos klientams paslaug\u0173 jums v\u0117luojant sumok\u0117ti mok\u0117jimus daugiau nei 5 (penkias) kalendorines dienas. ");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](136, "h5", 5);

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](137, "8. REITINGAS IR AKTYVUMAS");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](138, "p");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](139, "8.1. Sutinkate su tuo, kad, siekiant u\u017Etikrinti auk\u0161tos kokyb\u0117s aptarnavim\u0105 ir papildomai paskatinti pirk\u0117jus, pirk\u0117jai gal\u0117s jums paskirti \u012Fvertinim\u0105 ir palikti atsiliepim\u0105 apie j\u016Bs\u0173 suteikt\u0173 paslaug\u0173 kokyb\u0119. J\u016Bs\u0173 bendras reitingas bus susietas su j\u016Bs\u0173 tiek\u0117jo paskyra, o pirk\u0117jai j\u012F gal\u0117s matyti \u201EA\u0161 dirbu\" program\u0117l\u0117je. Su\u017Einoj\u0119, kad \u012Fvertinimas ar komentaras buvo palikti nes\u0105\u017Einingai, galime \u0161io \u012Fvertinimo ar komentaro ne\u012Fskai\u010Diuoti \u012F j\u016Bs\u0173 reiting\u0105. ");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](140, "p");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](141, "8.2. Be reitingo taip pat matuojame j\u016Bs\u0173 aktyvumo lyg\u012F ir skiriame jums aktyvumo bal\u0105, kuris yra paremtas tuo, kiek paslaug\u0173 pra\u0161ym\u0173 priimate, atmetate, ignoruojate ir \u012Fvykdote. ");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](142, "p");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](143, "8.3. Siekiant teikti patikimas paslaugas pirk\u0117jams, mes galime nustatyti ma\u017Eiausi\u0105 vidutin\u012F reiting\u0105 ir ma\u017Eiausi\u0105 aktyvumo bal\u0105, kur\u012F tiek\u0117jai privalo pasiekti ir i\u0161laikyti. Jei, gav\u0119 atitinkam\u0105 prane\u0161im\u0105 i\u0161 m\u016Bs\u0173, per nurodyt\u0105 laik\u0105 nepakeliate savo bendro reitingo ar aktyvumo balo iki ma\u017Eiausio reikalaujamo lygio, j\u016Bs\u0173 tiek\u0117jo paskyra automati\u0161kai laikinai arba visam laikui u\u017Eblokuojama. Paskyr\u0105 atblokuojame tai leidus i\u0161orin\u0117ms aplinkyb\u0117ms arba nusta\u010Dius, kad paskyra buvo u\u017Eblokuota d\u0117l sistemos klaidos ar netikr\u0173 atsiliepim\u0173.");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](144, "h5", 5);

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](145, "9. RINKOS AP\u017DVALGOS IR KAMPANIJOS");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](146, "p");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](147, "9.1. Rinkos ap\u017Evalgos. Mes per \u201EA\u0161 dirbu\" program\u0117l\u0119, \u201EA\u0161 dirbu\" tiek\u0117jo paskyr\u0105, SMS \u017Einute, el. pa\u0161tu ar kitomis priemon\u0117mis teiksime jums rinkos ap\u017Evalgas, taip siekdami jus informuoti apie laikotarpius, koki\u0173 paslaug\u0173 paklausa ir kokioje lokacijoje yra did\u017Eiausia. \u0160ios ap\u017Evalgos yra rekomendacinio pob\u016Bd\u017Eio ir j\u016Bs\u0173 niekaip nesaisto. Rinkos ap\u017Evalg\u0173 skai\u010Diavimai yra pagr\u012Fsti ankstesne statistika, tod\u0117l mes negalime jums garantuoti, kad reali rinkos situacija atitiks rinkos ap\u017Evalgoje pateiktus vertinimus. ");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](148, "p");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](149, "9.2. Kampanijos, u\u017Etikrinan\u010Dios minimal\u0173 u\u017Edarb\u012F. Mes taip pat galime taikyti kampanijas, u\u017Etikrinan\u010Dias minimal\u0173 u\u017Edarb\u012F jums per tam tikr\u0105 laik\u0105 atlikus paslaugas. Jei minimalaus u\u017Edarbio nepasieksite patys, mes padengsime skirtum\u0105. Konkre\u010Dius reikalavimus ir s\u0105lygas atsi\u0173sime per \u201EA\u0161 dirbu\" program\u0117l\u0119, \u201EA\u0161 dirbu\" tiek\u0117jo paskyr\u0105, SMS \u017Einute, el. pa\u0161tu ar kitomis priemon\u0117mis. Mes visi\u0161kai savo nuo\u017Ei\u016Bra sprend\u017Eiame, ar taikyti bei kada ir kuriems tiek\u0117jams taikyti min\u0117tas kampanijas. Mums pagr\u012Fstai jus \u012Ftarus suk\u010Diavus, galime sulaikyti mokes\u010Dio mok\u0117jim\u0105, kol \u012Ftarimas d\u0117l suk\u010Diavimo bus panaikintas.");

