          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](151, "9.3. Kampanijos pirk\u0117jams. Mes, siekdami paskatinti naudojim\u0105si \u201EA\u0161 dirbu\" platforma, taip pat galime kartais taikyti kampanijas pirk\u0117jams. Jei vykdant toki\u0105 kampanij\u0105 pirk\u0117jo mokamas mokestis suma\u017Einamas, mes i\u0161mok\u0117sime jums kompensacij\u0105, kurios dydis bus lygus pinginei pirk\u0117jui pasi\u016Blytos lengvatos vertei. Mes kompensacij\u0105 u\u017E rinkodaros akcij\u0105 taip pat galime atskaityti i\u0161 j\u016Bs\u0173 \u201EA\u0161 dirbu\" mokes\u010Dio. ");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();

