          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](154, "p");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](155, "10.1. Patvirtinate ir sutinkate, jog mes teikiame visuomen\u0117s informavimo, one paslaugas. Teikdami \u201EA\u0161 dirbu\" platform\u0105 bei \u201EA\u0161 dirbu\" paslaugas, veikiame kaip prekyviet\u0117, sujungianti pirk\u0117jus ir tiek\u0117jus bei padedanti jiems grei\u010Diau rasti tinkamas ir ar\u010Diausiai j\u0173 teikiamas paslaugas. Patvirtinate, kad teikiate paslaugas sutarties d\u0117l paslaug\u0173 teikimo pagrindu ir paslaugas teikiate savaranki\u0161kai arba per \u012Fmon\u0119, vykdydami ekonomin\u0119 arba profesin\u0119 veikl\u0105. ");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](156, "p");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](157, "10.2. Patvirtinate, kad tarp j\u016Bs\u0173 ir m\u016Bs\u0173 nebuvo ir nebus sudaryta darbo sutartis. Taip pat patvirtinate, kad j\u016Bs ir mes n\u0117ra \u012Fsteig\u0119 bendros \u012Fmon\u0117s arba partneryst\u0117s. Negalite veikti kaip m\u016Bs\u0173 darbuotojas, agentas ar atstovas arba m\u016Bs\u0173 vardu sudaryti saistan\u010Dios sutarties. Jei taip numa\u010Dius privalomiems \u012Fstatymams ar d\u0117l kit\u0173 prie\u017Eas\u010Di\u0173 b\u016Bsite traktuojamas kaip m\u016Bs\u0173 darbuotojas, sutinkate nekelti mums reikalavim\u0173, susijusi\u0173 su \u0161iais numatomais darbo santykiais. ");

