          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](158, "p");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](159, "10.3. Negalite perduoti I\u0161 \u0161i\u0173 Bendr\u0173j\u0173 s\u0105lyg\u0173 ar Sutarties kylan\u010Di\u0173 teisi\u0173 ir pareig\u0173 tretiesiems asmenims.");

