          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](169, "12.1. \u201EA\u0161 dirbu\" platforma teikiama dabartin\u0117s b\u016Bkl\u0117s, priklausomai nuo prieinamumo. Mes neparei\u0161kiame ir negarantuojame, kad prieiga prie \u201EA\u0161 dirbu\" platformos bus nepertraukiama ir be klaid\u0173. Kadangi paslaug\u0173 u\u017Esakymas per \u201EA\u0161 dirbu\" platform\u0105 priklauso nuo pirk\u0117j\u0173 elgsenos, mes negarantuojame jums, kad naudodamiesi \u201EA\u0161 dirbu\" platforma sulauksite pra\u0161ym\u0173.");

