          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](170, "p");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](171, "12.2. Iki taikomuose \u012Fstatymuose numatytos ribos mes, bei m\u016Bs\u0173 atstovai, direktoriai ir darbuotojai neatsakome u\u017E nuostolius ar \u017Eal\u0105, patirtus naudojantis \u201EA\u0161 dirbu\" paslaugomis, \u012Fskaitant, bet neapsiribojant: tiesiogine ar netiesiogine \u017Eala nuosavybei ar piniginiais nuostoliais; pelno arba planuot\u0173 santaup\u0173 praradimu; verslo galimybi\u0173, sutar\u010Di\u0173, kontakt\u0173, gero vardo, reputacijos praradimu arba kitais nuostoliais, susijusiais su verslo pertr\u016Bkiu; duomen\u0173 praradimu arba netikslumu; kitokio pob\u016Bd\u017Eio nuostoliais ar \u017Eala. ");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](172, "p");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](173, "12.3. M\u016Bs\u0173 finansin\u0117 atsakomyb\u0117, susijusi su Bendr\u0173j\u0173 s\u0105lyg\u0173 pa\u017Eeidimais, nevir\u0161ija 500 eur\u0173. Teis\u0119 reikalauti nuostoli\u0173 atlyginimo \u012Fgyjate tik mums ty\u010Dia pa\u017Eeidus Bendr\u0105sias s\u0105lygas. ");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](174, "p");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](175, "12.4. Mes neatsakome u\u017E pirk\u0117jo arba kit\u0173 asmen\u0173 veiksmus ar neveikim\u0105, \u017Eal\u0105 ar nuostolius, kuriuos jums ar j\u016Bs\u0173 turtui, darbo priemonei savo veiksmais ir neveikimu suk\u0117l\u0117 pirk\u0117jas ar kiti asmenys. ");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](176, "p");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](177, "12.5. Esate visi\u0161kai atsakingi u\u017E Bendr\u0173j\u0173 s\u0105lyg\u0173, sutarties ar kit\u0173 taikom\u0173 \u012Fstatym\u0173 ar teis\u0117s akt\u0173 pa\u017Eeidimus ir, gav\u0119 atitinkam\u0105 reikalavim\u0105 i\u0161 m\u016Bs\u0173 arba vald\u017Eios institucijos, privalote nedelsdami sustabdyti savo veiksmus ir i\u0161taisyti tok\u012F pa\u017Eeidim\u0105. Privalote mums atlyginti tiesioginius ir (arba) netiesioginius nuostolius ir (arba) \u017Eal\u0105, pelno praradim\u0105, i\u0161laidas, sankcijas ir baudas, patirtas m\u016Bs\u0173 d\u0117l j\u016Bs\u0173 \u012Fvykdyto Bendr\u0173j\u0173 s\u0105lyg\u0173, sutarties arba \u012Fstatym\u0173 ir teis\u0117s akt\u0173 pa\u017Eeidimo. Jei pirk\u0117jas mums parei\u0161kia reikalavimus d\u0117l j\u016Bs\u0173 atlikt\u0173 paslaug\u0173, privalote mums atlyginti \u0161iuos nuostolius per 7 (septynias) dienas nuo atitinkamo m\u016Bs\u0173 pra\u0161ymo gavimo. Mums \u012Fgijus teis\u0119 pareik\u0161ti jums reikalavimus, privalote atlyginti mums visas teisines i\u0161laidas, susijusias su nuostoli\u0173 \u012Fvertinimu ir reikalavim\u0173 d\u0117l toki\u0173 nuostoli\u0173 atlyginimo teikimu. ");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](178, "h5", 5);

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](179, "13. GALIOJIMAS IR NUTRAUKIMAS");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](180, "p");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](181, "13.1. Bendrosiose s\u0105lygose tiesiogiai apibr\u0117\u017Etos s\u0105lygos \u012Fsigalioja pateikus registracijos parai\u0161k\u0105. Sutartys ir kitos s\u0105lygos \u012Fsigalioja jums pateikus atitinkam\u0105 dokument\u0105 ar parei\u0161kim\u0105 ir jums prad\u0117jus ir toliau prat\u0119sus paslaug\u0173 teikim\u0105 per \u201EA\u0161 dirbu\" platform\u0105. ");

