          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](183, "13.2. Sutart\u012F galite nutraukti bet kuriuo metu, prane\u0161dami \u201EA\u0161 dirbu\" bent prie\u0161 7 (septynias) dienas \u2013 \u0161iam terminui pra\u0117jus, j\u016Bs\u0173 teis\u0117 naudotis \u201EA\u0161 dirbu\" platforma ir \u201EA\u0161 dirbu\" paslaugomis nutraukiama. \u201EA\u0161 dirbu\" gali savo nuo\u017Ei\u016Bra bet kuriuo metu ir d\u0117l bet kokios prie\u017Easties nutraukti sutart\u012F, prane\u0161dami ne v\u0117liau kaip prie\u0161 3 (tris) dienas. ");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](184, "p");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](185, "13.3. \u201EA\u0161 dirbu\" turi teis\u0119 nedelsdami be i\u0161ankstinio \u012Fsp\u0117jimo nutraukti sutart\u012F ir u\u017Eblokuoti j\u016Bs\u0173 prieig\u0105 prie \u201EA\u0161 dirbu\" platformos, jums pa\u017Eeidus Bendr\u0105sias s\u0105lygas arba sutart\u012F, taikomus \u012Fstatymus ar teis\u0117s aktus, nepagarbiai neatsiliepus apie \u201EA\u0161 dirbu\" arba suk\u0117lus gr\u0117sm\u0119 \u201EA\u0161 dirbu\" prek\u0117s \u017Eenklui, reputacijai ar verslui, kai tai savo nuo\u017Ei\u016Bra nustato \u201EA\u0161 dirbu\". Min\u0117tais atvejais galime savo nuo\u017Ei\u016Bra u\u017Edrausti jums registruoti nauj\u0105 tiek\u0117jo paskyr\u0105.");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](186, "p");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](187, "13.4. Taip pat galime nedelsdami u\u017Eblokuoti j\u016Bs\u0173 prieig\u0105 prie \u201EA\u0161 dirbu\" platformos ir \u201EA\u0161 dirbu\" tiek\u0117jo paskyros tiriamajam laikotarpiui, jei \u012Ftariame jus pa\u017Eeidus sutart\u012F ar suk\u010Diavus. Paskyra atblokuojama tyrimui panaikinus \u0161iuos \u012Ftarimus. ");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](188, "p");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](189, "13.5. Siekdami visiems pirk\u0117jams suteikti auk\u0161\u010Diausios kokyb\u0117s aptarnavim\u0105, stebime tiek\u0117j\u0173 veikl\u0105 \u201EA\u0161 dirbu\" platformoje. Jums ne\u012Fvykd\u017Eius minimali\u0173 aptarnavimo reikalavim\u0173, toki\u0173 kaip minimalus reitingas ar aktyvumo balas, turime teis\u0119 nedelsdami be i\u0161ankstinio \u012Fsp\u0117jimo nutraukti sutart\u012F.");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](190, "h5", 5);

