          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](202, "15.1. Bendr\u0105sias s\u0105lygas reglamentuoja, jos ai\u0161kinamos ir \u012Fgyvendinamos remiantis Lietuvos Respublikos \u012Fstatymais. Jei i\u0161 Bendr\u0173j\u0173 s\u0105lyg\u0173 ar sutarties kilusio gin\u010Do nepavyksta i\u0161spr\u0119sti deryb\u0173 keliu, gin\u010Das bus sprend\u017Eiamas Vilniaus apygardos teisme. ");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();

