          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](207, "p");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](208, "16.2. Bet koks prane\u0161imas, teiktinas pagal Bendr\u0105sias s\u0105lygas, laikomas tinkamai pateiktu, jei yra i) pristatomas asmeni\u0161kai; ii) i\u0161siun\u010Diamas per kurjer\u012F, i\u0161duodant pristatymo patvirtinim\u0105; iii) i\u0161siun\u010Diamas registruotu pa\u0161tu; iv) i\u0161siun\u010Diamas el. pa\u0161tu; arba v) pateikiamas per \u201EA\u0161 dirbu\" program\u0117l\u0119 arba \u201EA\u0161 dirbu\" tiek\u0117jo paskyr\u0105. Pagal \u0161io punkto nuostatas i\u0161si\u0173stas prane\u0161imas laikomas gautu: i) jei pristatoma asmeni\u0161kai, \u2013 pristatymo \u0161aliai momentu; ii) jei pristatoma per kurjer\u012F, \u2013 kurjerio nurodyt\u0105 dien\u0105, kuri yra voko su prane\u0161imu pristatymo \u0161aliai diena; iii) jei siun\u010Diama registruotu pa\u0161tu, \u2013 de\u0161imt\u0105 dien\u0105 nuo dokumento perdavimo pa\u0161to skyriui siuntimui kitai \u0161aliai; iv) jei teikiama per \u201EA\u0161 dirbu\" program\u0117l\u0119 arba \u201EA\u0161 dirbu\" tiek\u0117jo paskyr\u0105 arba v) el. pa\u0161tu,\u2013 dien\u0105, kai gaunan\u010Dioji \u0161alis el. pa\u0161tu patvirtina, kad gavo atitinkam\u0105 el. lai\u0161k\u0105 arba antr\u0105 dien\u0105 nuo el. lai\u0161ko i\u0161siuntimo, jei siunt\u0117jas, negav\u0119s prane\u0161imo apie klaid\u0105 (prane\u0161an\u010Dio, kad el. lai\u0161kas nepasiek\u0117 \u0161alies), i\u0161siunt\u0117 el. lai\u0161k\u0105 dar kart\u0105 kit\u0105 kalendorin\u0119 dien\u0105 ir taip pat negavo pana\u0161aus prane\u0161imo apie klaid\u0105. ");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();

