          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](217, "p");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](218, "\u0160iose Bendrosiose nuostatose ir s\u0105lygose pateikiamos nuostatos ir s\u0105lygos, taikomos ir kuriomis reglamentuojamas \u201EA\u0161 dirbu\u201C program\u0117l\u0117s naudojimas \u2013 technologijos, kuria paslaug\u0173 tiek\u0117jai sujungiami su pirk\u0117jais. S\u0105vokos \u201Emes\u201C ar \u201Em\u016Bs\u0173\u201C nurodo \u201EA\u0161 dirbu\u201C program\u0117l\u0117s savinink\u0105 UAB \u201CPILKA LINIJA\u201D, u\u017Edar\u0105j\u0105 akcin\u0119 bendrov\u0119, \u012Fregistruot\u0105 Lietuvos Respublikoje (\u012Fmon\u0117s kodas 304093955), \u012Fmon\u0117s adresas Taikos 263a-76, VILNIUS, LIETUVA.");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](219, "p");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](220, "Kad gal\u0117tum\u0117te naudotis \u201EA\u0161 dirbu\u201C program\u0117le, privalote sutikti su nuostatomis ir s\u0105lygomis, kurios pateikiamos toliau.");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](221, "h5", 5);

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](222, "1. Naudojimasis \u201EA\u0161 dirbu\u201C program\u0117le");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](223, "p");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](224, "1.1 \u201EA\u0161 dirbu\u201C teikia informacin\u0117s visuomen\u0117s paslaug\u0105, bet neteikia \u012Fdarbinimo paslaug\u0173. Visas si\u016Blomas paslaugas teikia tiek\u0117jai pagal sutart\u012F (su jumis) d\u0117l paslaug\u0173 teikimo. Tiek\u0117jai teikia paslaugas nepriklausomai (asmeni\u0161kai arba per \u012Fmon\u0119), kaip ekonomini\u0173 ir profesionali\u0173 paslaug\u0173 teik\u0117jai. Gin\u010Dai, kylantys d\u0117l vartotoj\u0173 teisi\u0173, teisini\u0173 \u012Fsipareigojim\u0173 ar \u012Fstatym\u0173, kurie taikytini paslaug\u0173 teikimui, bus sprend\u017Eiami tarp pirk\u0117j\u0173 ir tiek\u0117j\u0173. Duomenys apie tiek\u0117jus ir j\u0173 teikiam\u0105 paslaug\u0105 teikiami \u201EA\u0161 dirbu\u201C program\u0117l\u0117je, o kvitai u\u017E atlikts paslaugas nusiun\u010Diami elektroninio pa\u0161to adresu, nurodytu pirk\u0117jo profilyje. ");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](225, "p");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](226, "1.2 Naudodamiesi \u201EA\u0161 dirbu\u201C program\u0117le, galite mok\u0117ti Ti\u0117k\u0117jui u\u017E paslaug\u0105, \u201EA\u0161 dirbu\u201C mok\u0117jimu program\u0117le. Kai privaloma pagal \u012Fstatym\u0105, \u012F paslaug\u0173 mokes\u010Dius \u012Feina taikytini mokes\u010Diai. \u012E paslaug\u0173 mokes\u010Dius gali \u012Feiti kiti taikytini mokes\u010Diai, rinkliavos ir (arba) priemokos, \u012Fskaitant u\u017Esakymo mokest\u012F, savivaldybi\u0173 rinkliavas, parkavimo mokes\u010Diai arba apdorojimo mokes\u010Dius. ");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](227, "p");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](228, "1.3 \u012Ediegiant \u201EA\u0161 dirbu\u201C program\u0117l\u0119, pirk\u0117jo mobiliojo telefono numeris yra susiejamas su atitinkamo \u201EA\u0161 dirbu\u201C naudotojo paskyra ir \u012Ftraukiamas \u012F m\u016Bs\u0173 duomen\u0173 baz\u0119. Jeigu j\u016Bs nebesinaudojate savo mobiliuoju numeriu, privalote per 7 dienas informuoti \u201EA\u0161 dirbu\u201C, kad mes j\u016Bs\u0173 paskyros duomenis padarytume anoniminius. Jeigu neinformuojate m\u016Bs\u0173 apie numerio pasikeitim\u0105, j\u016Bs\u0173 mobiliojo ry\u0161io operatorius gali \u0161\u012F numer\u012F priskirti kitam asmeniui, kuris naudodamasis \u201EA\u0161 dirbu\u201C program\u0117le gal\u0117s matyti j\u016Bs\u0173 duomenis.");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](229, "h5", 5);

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](230, "2. Reklaminiai kodai");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](231, "p");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](232, "2.1 \u201EA\u0161 dirbu\u201C gali si\u0173sti jums reklaminius kodus. Reklamini\u0173 kod\u0173 kreditai gali b\u016Bti taikomi mok\u0117jimams u\u017Ebaigus paslaug\u0173 pirkim\u0105 ar kitoms funkcijoms ar naudai, susijusiai su paslauga ir (arba) tre\u010Di\u0173j\u0173 \u0161ali\u0173 paslauga; kodams gali b\u016Bti taikomos papildomos s\u0105lygos, kurios nustatomos kiekvieno reklaminio kodo atveju. Reklamini\u0173 kod\u0173 galiojimo datos bus nurodomos program\u0117l\u0117je, kai prie savo paskyros priskirsite reklamin\u012F kod\u0105. ");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](233, "p");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](234, "2.2 Jeigu j\u016Bs\u0173 paslaug\u0173 pirkimo suma vir\u0161ija i\u0161kei\u010Diam\u0105 kredit\u0105, priskirt\u0105 j\u016Bs\u0173 paslaugai, likutis bus automati\u0161kai nuskai\u010Diuotas pagal j\u016Bs\u0173 paskyros mok\u0117jimo metod\u0105. Be to, reklaminis kodas galioja tik vienam paslaug\u0173 pirkimui, jo negalima perkelti kitam u\u017Esakymui, tod\u0117l v\u0117liau jis anuliuojamas. Paslaug\u0173 u\u017Esakymo metu gali b\u016Bti panaudotas tik vienas reklaminis kodas.");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](235, "p");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](236, "2.3 \u201EA\u0161 dirbu\u201C pasilieka teis\u0119 d\u0117l bet kokios prie\u017Easties bet kuriuo metu panaikinti bet kok\u012F reklamin\u012F kod\u0105. Tokie atvejai gali b\u016Bti (ta\u010Diau jais neapsiribojama): \u201EA\u0161 dirbu\u201C laiko, kad kodai naudojami neteis\u0117tai arba suk\u010Diaujant, kodai i\u0161duoti per klaid\u0105, kod\u0173 galiojimo laikas baig\u0117si. ");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](237, "h5", 5);

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](238, "3. Mok\u0117jimas \u201EA\u0161 dirbu\u201C program\u0117le");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](239, "p");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](240, "3.1 J\u016Bs galite sumok\u0117ti u\u017E paslaugas \u201EA\u0161 dirbu\u201C program\u0117l\u0117je. Teikdama mok\u0117jimo \u201EA\u0161 dirbu\u201C program\u0117le paslaug\u0105, \u201EA\u0161 dirbu\u201C veikia kaip komercinis paslaug\u0173 teik\u0117j\u0173 agentas. J\u016Bs\u0173 \u012Fsipareigojimas paslaugos teik\u0117jui \u012Fvykdomas, kai yra pateikiamas mok\u0117jimo nurodymas pervesti l\u0117\u0161as \u012F \u201EA\u0161 dirbu\u201C banko s\u0105skait\u0105. Kaip paslaugos pirk\u0117jas, j\u016Bs privalote u\u017Etikrinti, kad \u012Fvykt\u0173 mok\u0117jimas ir kad s\u0105skaitoje b\u016Bt\u0173 pakankamai l\u0117\u0161\u0173. ");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](241, "p");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](242, "3.2 Atliekant mok\u0117jimus \u201EA\u0161 dirbu\u201C program\u0117le, \u201EA\u0161 dirbu\u201C gauna j\u016Bs\u0173 mok\u0117jimus ir persiun\u010Dia pinigus paslaug\u0173 tiek\u0117jui. \u201EA\u0161 dirbu\u201C gali papra\u0161yti i\u0161 j\u016Bs\u0173 papildom\u0173 duomen\u0173, kad patvirtint\u0173 mok\u0117jimo metod\u0105. ");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](243, "p");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](244, "3.3 Atliekant mok\u0117jimus u\u017E paslaugas \u201EA\u0161 dirbu\u201C program\u0117le, \u201EA\u0161 dirbu\u201C neatsako u\u017E galimus tre\u010Di\u0173j\u0173 \u0161ali\u0173 mokes\u010Dius (pvz., mobiliojo ry\u0161io operatori\u0173, banko mokes\u010Dius). \u0160ie paslaug\u0173 teik\u0117jai, apdorodami mok\u0117jimus, atliekamus \u201EA\u0161 dirbu\u201C program\u0117le, gali taikyti papildomus mokes\u010Dius. \u201EA\u0161 dirbu\u201C neatsako u\u017E tokius mokes\u010Dius ir i\u0161si\u017Eada bet kokios su tuo susijusios atsakomyb\u0117s. J\u016Bs\u0173 mok\u0117jimo metodui taip pat gali b\u016Bti taikomos papildomos nuostatos ir s\u0105lygos, kurias taiko tre\u010Di\u0173j\u0173 \u0161ali\u0173 mok\u0117jimo paslaug\u0173 teik\u0117jas; prie\u0161 pasirinkdami mok\u0117jimo metod\u0105, per\u017Ei\u016Br\u0117kite \u0161ias nuostatas ir s\u0105lygas. ");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](245, "p");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](246, "3.4 \u201EA\u0161 dirbu\u201C atsako u\u017E mok\u0117jimo \u201EA\u0161 dirbu\u201C program\u0117le funkcionavim\u0105 ir teikia pagalb\u0105 sprend\u017Eiant problemas. Gin\u010Dai, susij\u0119 su mok\u0117jimais \u201EA\u0161 dirbu\u201C program\u0117le, taip pat sprend\u017Eiami \u012Fsitraukiant mums. D\u0117l pagalbos, susijusios su mok\u0117jimais, susisiekite:");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](247, "a", 7);

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](248, "info@asdirbu.lt.");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](249, "\xA0 \u012E u\u017Eklausas, pateiktas elektroniniu pa\u0161tu arba per \u201EA\u0161 dirbu\u201C program\u0117l\u0119, bus atsakyta per vien\u0105 darbo dien\u0105. ");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](250, "p");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](251, "\u201EA\u0161 dirbu\u201C skundus, susijusius su mok\u0117jimais \u201EA\u0161 dirbu\u201C program\u0117le, ir pra\u0161ymus i\u0161spr\u0119s per dvi darbo dienas.");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](252, "h5", 5);

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](253, "4. Paslaug\u0173 u\u017Esakymas ir at\u0161aukimas");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](254, "p");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](255, "4.1 Jeigu j\u016Bs u\u017Esisak\u0117te paslaug\u0105, o tiek\u0117jas sutiko atlikti darb\u0105, tuomet laikoma, kad paslauga u\u017Esakyta. ");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](256, "p");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](257, "4.2 Kai tiek\u0117jas patvirtina, kad \u012Fvykdys j\u016Bs\u0173 u\u017Esakym\u0105, j\u016Bs sudarysite atskir\u0105 sutart\u012F su tiek\u0117ju d\u0117l paslaug\u0173 teikimo tokiomis nuostatomis ir s\u0105lygomis, d\u0117l kuri\u0173 sutariate su tiek\u0117ju. \u201EA\u0161 dirbu\u201C neteikia paslaug\u0173 ir n\u0117ra j\u016Bs\u0173 sutartis su atitinkamu tiek\u0117ju \u0161alis.");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](258, "p");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](259, "4.3 U\u017Esakytos paslaugos at\u0161aukimas yra laikomas situacija, kai tiek\u0117jas atsak\u0117 \u012F j\u016Bs\u0173 u\u017Eklaus\u0105 ir patvirtino u\u017Esakym\u0105, o j\u016Bs v\u0117liau atmetate, at\u0161aukiate arba atsisakote paslaugos. Kai paslaugos u\u017Eklausa yra at\u0161aukiama po tam tikro laiko, j\u016Bs privalote sumok\u0117ti at\u0161aukimo mokest\u012F. ");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](260, "p");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](261, "4.4 Jeigu j\u016Bs at\u0161aukiate paslaugos u\u017Eklaus\u0105 v\u0117liau kelis kartus per 24 valandas, \u012Fsp\u0117dami mes galime laikinai u\u017Eblokuoti j\u016Bs\u0173 paskyr\u0105. Po keli\u0173 toki\u0173 \u012Fsp\u0117jim\u0173 galime suspenduoti j\u016Bs\u0173 paskyr\u0105 ilgesniam laikotarpiui (pvz., 6 m\u0117nesiams). Po \u0161io laikotarpio galite pra\u0161yti v\u0117l aktyvuoti j\u016Bs\u0173 paskyr\u0105, o j\u016Bs\u0173 pra\u0161ym\u0105 per\u017Ei\u016Br\u0117s \u201EA\u0161 dirbu\u201C. ");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](262, "p");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](263, "4.5 Kai paslaugos tiek\u0117jas informuoja pirk\u0117j\u0105 apie atvykim\u0105 \u012F nustatyt\u0105 viet\u0105, o pirk\u0117jas ar \u017Emon\u0117s, kuriems paslauga buvo u\u017Esakyta, nepasirodo sutartoje vietoje per tam tikr\u0105 laik\u0105, nurodyt\u0105 \u201EA\u0161 dirbu\u201C program\u0117l\u0117je, u\u017Eklausa laikoma at\u0161aukta. Kartais tiek\u0117jas gali nuspr\u0119sti at\u0161aukti j\u016Bs\u0173 u\u017Eklaus\u0105; atkreipiame d\u0117mes\u012F, kad \u201EA\u0161 dirbu\u201C u\u017E tokias situacijas neatsako. ");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](264, "p");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](265, "4.6 Kai tiek\u0117jas atvyksta ir atsiun\u010Dia jums prane\u0161im\u0105, kad atvyko, \u201EA\u0161 dirbu\u201C program\u0117l\u0117 gali prad\u0117ti skai\u010Diuoti mokest\u012F u\u017E laukimo laik\u0105 pagal \u012Fkainius, nurodytus \u201EA\u0161 dirbu\u201C program\u0117l\u0117je. ");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](266, "p");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](267, "4.7 Jeigu j\u016Bs u\u017Esisakote paslaug\u0105 naudodamiesi \u201EA\u0161 dirbu\u201C program\u0117le ir tiek\u0117jas padaro \u017Ealos j\u016Bs\u0173 turtui ar \u012Frangai arba u\u017Esakovas apgadina tiek\u0117jo turt\u0105 (apgadinama technika, turtas, netenkinama paslaug\u0173 kokyb\u0117, ar palauga nei\u0161sprend\u0117 J\u016Bs\u0173 problemos), pirk\u0117jas ir tiek\u0117jas turi teis\u0119 reikalauti kitos \u0161alies sumok\u0117ti 50 eur\u0173 baud\u0105 ir reikalauti kompensacijos u\u017E \u017Eal\u0105, kuri vir\u0161ija baud\u0105. Jeigu j\u016Bs nesumokate baudos ir (arba) kompensacijos u\u017E \u017Eal\u0105, \u201EA\u0161 dirbu\u201C gali pareik\u0161ti ie\u0161kin\u012F paslaugos teik\u0117jo ar paslaugos pirk\u0117jo vardu.");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](268, "h5", 5);

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](269, "5. Leidimas naudotis \u201EA\u0161 dirbu\u201C program\u0117le");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](270, "p");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](271, "5.1 Kol j\u016Bs laikot\u0117s \u0161i\u0173 Bendr\u0173j\u0173 nuostat\u0173 ir s\u0105lyg\u0173, mes sutinkame suteikti jums nemokam\u0105, at\u0161aukiam\u0105, nei\u0161skirtin\u0119 teis\u0119 pasiekti \u201EA\u0161 dirbu\u201C program\u0117l\u0119 ir naudotis ja pagal \u0161ias Bendr\u0105sias nuostatas ir s\u0105lygas, Privatumo prane\u0161im\u0105 ir taikytinas program\u0117li\u0173 parduotuv\u0117s s\u0105lygas. J\u016Bs negalite perduoti arba sublicencijuoti \u0161ios teis\u0117s naudotis \u201EA\u0161 dirbu\u201C program\u0117le. Tuo atveju, jeigu j\u016Bs\u0173 teis\u0117 naudotis \u201EA\u0161 dirbu\u201C program\u0117le bus panaikinta, atitinkama nei\u0161skirtin\u0117 licencija taip pat bus panaikinta.");

