          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](275, "6.1 Kadangi \u201EA\u0161 dirbu\u201C program\u0117l\u0117 yra informacin\u0117s visuomen\u0117s paslauga (ry\u0161io priemon\u0117) tarp paslaug\u0173 pirk\u0117j\u0173 ir paslaug\u0173 tiek\u0117j\u0173, mes negalime garantuoti ar prisiimti atsakomyb\u0117s u\u017E kokyb\u0119 ar defekt\u0173 nebuvim\u0105 teikiant paslaugas. Kadangi naudojimasis \u201EA\u0161 dirbu\u201C program\u0117le u\u017Esakant paslaugas priklauso nuo tiek\u0117j\u0173 ir pirk\u0117j\u0173 elgesio, \u201EA\u0161 dirbu\u201C negarantuoja, kad j\u016Bs visuomet gausite pasi\u016Blym\u0173 d\u0117l paslaug\u0173 teikimo. ");

