          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](276, "p");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](277, "6.2 \u201EA\u0161 dirbu\u201C program\u0117l\u0117 nesi\u016Blo ir netarpininkauja d\u0117l paslaug\u0173 pirk\u0117jams. Tai taip pat n\u0117ra \u012Fdarbinimo agent\u016Bros tarnyba, skirta surasti paslaug\u0173 teik\u0117jams. \u201EA\u0161 dirbu\u201C program\u0117l\u0117 yra naudojama kaip priemon\u0117 organizuoti paslaug\u0173 teikim\u0105. ");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](278, "p");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](279, "6.1 \u201EA\u0161 dirbu\u201C program\u0117l\u0117s u\u017Esakymams netaikoma vartotojo teis\u0117 \u012F pinig\u0173 gr\u0105\u017Einim\u0105. Pra\u0161ydami pinig\u0173 gr\u0105\u017Einimo u\u017E suteikt\u0105 paslaug\u0105, j\u016Bs neatsiribojate nuo sutarties, pagal kuri\u0105 buvo u\u017Esakytas paslaugos teikimas. ");

