          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](280, "p");

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](281, "6.4 \u201EA\u0161 dirbu\u201C program\u0117l\u0117 yra pateikiama \u201Etokia, kokia yra\u201C ir \u201Ekaip pasiekiama\u201C. \u201EA\u0161 dirbu\u201C netvirtina ir negarantuoja, kad \u201EA\u0161 dirbu\u201C program\u0117l\u0117s pasiekiamumas bus nepertraukiamas ar be klaid\u0173. \u012Evykus programin\u0117s \u012Frangos gedimams, mes stengsim\u0117s i\u0161taisyti juos kaip \u012Fmanoma grei\u010Diau, ta\u010Diau tur\u0117kite galvoje, kad program\u0117l\u0117s veikimas gali b\u016Bti apribotas d\u0117l atsitiktini\u0173 technini\u0173 klaid\u0173 ir mes negalime garantuoti, kad program\u0117l\u0117 veiks visuomet, pavyzd\u017Eiui, paslauga gali nutr\u016Bkti ekstremalios situacijos atveju. ");

